链表

物理储存单元非连续、非顺序的储存结构，由一系列节点构成
节点用来存储数据。一部分是存储数据的数据域，一个部分是存储指向下一个节点的指针域

相关概念

首尾节点
链表中第一个节点是首节点，最后一个节点是尾节点


有头链表与无头链表
无头链表指的是第一个节点既有指针域，又有数据域，第一个节点既是首节点，又是头节点。
有头链表指的是第一个节点只有指针域，没有数据域。



