function LinkList() {
  var Node = function(data) {
    this.data = data;
    this.next = null;
  }

  var length = 0;
  var head = null;
  var tail = null;

  // 添加节点
  // 1. 修改最后一个节点的指针域（指向新节点）
  // 2. 修改最后一个节点的数据域为新节点
  // 3. 更新 length 属性
  this.append = function(data) {
    var newNode = new Node(data);

    if (head == null) {
      head = newNode;
      tail = newNode;
    } else {
      // 将指针域指向新节点，修改尾节点为新节点（先修改指针域）
      tail.next = newNode;
      tail = newNode
    }

    length += 1;

    return true;
  };
}
