队列的概念
队列是一种特殊的线性表，特殊之处在于只允许在队列的头部删除元素，队列的尾部添加元素。
队列方法

enqueue，从队列尾部添加一个元素
dequeue，从队列头部删除一个元素
head，返回队列头部元素
size，返回队列大小
clear，清空队列
isEmpty，判断队列是否为空
tail，返回队列尾节点

实现方式
数组方式实现
function Queue() {
  var items = [];

  this.enqueue = function(item) {
    items.push(item);
  }

  this.dequeue = function() {
    return items.shift();
  }

  this.head = function() {
    return items[0];
  }

  this.size = function() {
    return items.length;
  }

  this.isEmpty = function() {
    return items.length === 0;
  }

  this.clear = function() {
    items.length = 0;
  }

  this.tail = function() {
    return items[items.length - 1];
  }
}
